import React from 'react';
import { Box, Button, Typography, Grid, Card } from '@mui/material';
import { Link, useNavigate } from 'react-router-dom';

const Header = ({ setIsLoggedIn }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear login state
    setIsLoggedIn(false);
    // Redirect to login page
    navigate("/login");
  };

  return (
    <Box sx={{ padding: 4 }}>
      {/* Header Section with Logout Button */}
      <div style={{ position: 'relative', padding: '16px' }}>
      {/* Simple Logout Button positioned at the top-right corner */}
      <button 
        onClick={handleLogout}
        style={{
          position: 'absolute',
          top: '16px',
          right: '16px',
          padding: '8px 16px', // Small size
          fontSize: '0.9rem',
          backgroundColor: '#d32f2f', // Red color
          color: 'white',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
          boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
        }}
      >
        Logout
      </button>
    </div>

      {/* 3D Effect Cards for Navigation */}
      <Grid container spacing={4} justifyContent="center">
        <Grid item>
          <Card
            sx={{
              width: 200,
              height: 200,
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              backgroundColor: '#f5f5f5',
              boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
              borderRadius: '10px',
              transition: 'all 0.3s ease',
              '&:hover': {
                boxShadow: '0 12px 20px rgba(0, 0, 0, 0.2)',
                transform: 'scale(1.05)',
              }
            }}
          >
            <Link to="/deposit" style={{ textDecoration: 'none' }}>
              <Typography variant="h6" sx={{ color: '#333', fontWeight: 'bold' }}>
                Deposit
              </Typography>
            </Link>
          </Card>
        </Grid>
        <Grid item>
          <Card
            sx={{
              width: 200,
              height: 200,
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              backgroundColor: '#f5f5f5',
              boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
              borderRadius: '10px',
              transition: 'all 0.3s ease',
              '&:hover': {
                boxShadow: '0 12px 20px rgba(0, 0, 0, 0.2)',
                transform: 'scale(1.05)',
              }
            }}
          >
            <Link to="/withdraw" style={{ textDecoration: 'none' }}>
              <Typography variant="h6" sx={{ color: '#333', fontWeight: 'bold' }}>
                Withdraw
              </Typography>
            </Link>
          </Card>
        </Grid>
        <Grid item>
          <Card
            sx={{
              width: 200,
              height: 200,
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              backgroundColor: '#f5f5f5',
              boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
              borderRadius: '10px',
              transition: 'all 0.3s ease',
              '&:hover': {
                boxShadow: '0 12px 20px rgba(0, 0, 0, 0.2)',
                transform: 'scale(1.05)',
              }
            }}
          >
            <Link to="/transfer" style={{ textDecoration: 'none' }}>
              <Typography variant="h6" sx={{ color: '#333', fontWeight: 'bold' }}>
                Transfer Money
              </Typography>
            </Link>
          </Card>
        </Grid>
        <Grid item>
          <Card
            sx={{
              width: 200,
              height: 200,
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              backgroundColor: '#f5f5f5',
              boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
              borderRadius: '10px',
              transition: 'all 0.3s ease',
              '&:hover': {
                boxShadow: '0 12px 20px rgba(0, 0, 0, 0.2)',
                transform: 'scale(1.05)',
              }
            }}
          >
            <Link to="/check-balance" style={{ textDecoration: 'none' }}>
              <Typography variant="h6" sx={{ color: '#333', fontWeight: 'bold' }}>
                Check Balance
              </Typography>
            </Link>
          </Card>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Header;
